import React from "react";
import "./Courses.css";

const Courses = () => {
  return (
    <section className="courses">
      <h2>Explore Your Career Fit</h2>
      <p>Grab the opportunity today and get recommended mentorship programs to improve your knowledge in agriculture.</p>
      <div className="course-grid">
        <div className="course-card">Organic Farming</div>
        <div className="course-card">Agriculture Economics</div>
        <div className="course-card">Agricultural Digital Technology</div>
        <div className="course-card">Animal Care Skills</div>
      </div>
    </section>
  );
};

export default Courses;
